def load_warehouse(input_str):
    warehouse = [list(line) for line in input_str.strip().split('\n')]
    return warehouse

def find_robot(warehouse):
    for y, row in enumerate(warehouse):
        for x, cell in enumerate(row):
            if cell == '@':
                return x, y
    return None

def move_robot(warehouse, moves):
    directions = {
        '<': (0, -1),
        '>': (0, 1),
        '^': (-1, 0),
        'v': (1, 0)
    }
    robot_x, robot_y = find_robot(warehouse)
    for move in moves:
        dy, dx = directions[move]
        new_x, new_y = robot_x + dx, robot_y + dy
        if warehouse[new_y][new_x] == '.':
            warehouse[robot_y][robot_x] = '.'
            warehouse[new_y][new_x] = '@'
            robot_x, robot_y = new_x, new_y

        elif warehouse[new_y][new_x] == 'O':
            box_new_x, box_new_y = new_x + dx, new_y + dy
            while warehouse[box_new_y][box_new_x] == 'O':
                box_new_x += dx
                box_new_y += dy

            if warehouse[box_new_y][box_new_x] == '.':
                warehouse[box_new_y][box_new_x] = 'O'

                warehouse[robot_y][robot_x] = '.'
                warehouse[new_y][new_x] = '@'
                robot_x, robot_y = new_x, new_y


        elif warehouse[new_y][new_x] == '#':
            continue

    return warehouse

def show_warehouse(warehouse):
    for row in warehouse:
        print(''.join(row))
    print()

def solve(input_str, moves):
    warehouse = load_warehouse(input_str)
    warehouse = move_robot(warehouse, moves)

    return warehouse

def sum_box_locations(warehouse):
    total = 0
    for y, row in enumerate(warehouse):
        for x, cell in enumerate(row):
            if cell == 'O':
                total += 100 * y + x
    return total

